import React, { useState, useEffect } from "react";
import axios from "axios";
import "./DoctorProfile.css";

const DoctorProfile = () => {
  const [profileData, setProfileData] = useState(null);
  const [formData, setFormData] = useState({
    doctorId: "",
    doctorName: "",
    speciality: "",
    location: "",
    mobileNo: "",
    email: "",
    experience: "",
    password: "",
  });

  const [userId, setUserId] = useState("");
  const [isProfileSaved, setIsProfileSaved] = useState(false); // Track if profile is saved

  // Fetch userId from localStorage or sessionStorage
  useEffect(() => {
    const storedUserId = localStorage.getItem("userId") || sessionStorage.getItem("userId");

    if (storedUserId) {
      setUserId(storedUserId); // Set userId from storage
      console.log("User ID retrieved:", storedUserId);
    } else {
      console.error("Error: userId not found in localStorage or sessionStorage.");
    }
  }, []);

  // Fetch profile data from the backend using userId
  useEffect(() => {
    if (!userId) return;

    const fetchDoctorData = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/doctor/getDoctorByEmail?email=${userId}`);
        if (response.data) {
          setProfileData(response.data);
          setFormData(response.data); // Populate the form with fetched data
          alert("Doctor profile fetched successfully!");
        } else {
          alert("No doctor found with this email.");
        }
      } catch (error) {
        console.error("Error fetching profile:", error);
      }
    };

    fetchDoctorData();
  }, [userId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:8000/doctor/addDoctor", formData);
      alert("Profile saved successfully!");
      setProfileData(response.data);
      setIsProfileSaved(true); // Set the flag when profile is saved
    } catch (error) {
      console.error("Error saving profile:", error);
    }
  };

  return (
    <div className="doctorProfile">
      {!isProfileSaved ? ( // Render form if profile is not saved
        <>
          <h2>{profileData ? "Edit Doctor Profile" : "Create Doctor Profile"}</h2>
          <form onSubmit={handleSubmit}>
            <input
              name="doctorName"
              placeholder="Name"
              value={formData.doctorName}
              onChange={handleChange}
              required
            />
            <input
              name="doctorId"
              placeholder="Doctor ID"
              value={formData.doctorId}
              onChange={handleChange}
              required
            />
            <input
              name="speciality"
              placeholder="Specialization"
              value={formData.speciality}
              onChange={handleChange}
              required
            />
            <input
              name="location"
              placeholder="Location"
              value={formData.location}
              onChange={handleChange}
              required
            />
            <input
              name="mobileNo"
              placeholder="Mobile No"
              value={formData.mobileNo}
              onChange={handleChange}
              required
            />
            <input
              name="email"
              placeholder="Email"
              value={formData.email}
              onChange={handleChange}
              required
            />
            <input
              name="experience"
              placeholder="Experience"
              value={formData.experience}
              onChange={handleChange}
              required
            />
            <input
              type="password"
              name="password"
              placeholder="Password"
              value={formData.password}
              onChange={handleChange}
              required
            />
            <button type="submit">Save Profile</button>
          </form>
        </>
      ) : (
        // Render profile info after profile is saved
        <div className="card">
          <h3>Doctor Profile</h3>
          <p><strong>Name:</strong> {profileData.doctorName}</p>
          <p><strong>Specialization:</strong> {profileData.speciality}</p>
          <p><strong>Doctor ID:</strong> {profileData.doctorId}</p>
          <p><strong>Location:</strong> {profileData.location}</p>
          <p><strong>Mobile No:</strong> {profileData.mobileNo}</p>
          <p><strong>Email:</strong> {profileData.email}</p>
          <p><strong>Experience:</strong> {profileData.experience}</p>
        </div>
      )}
    </div>
  );
};

export default DoctorProfile;
